INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (102301, 0.0, 24001, "アヤネ", 24, 2, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 401, "2020/07/31 12:00:00", 10046, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (102301, 0.0, 24002, "アヤネ", 24, 1, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2, 402, "2020/07/31 12:00:00", 10046, 2.21, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (102301, 0.0, 24003, "アヤネ", 24, 2, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 403, "2020/07/31 12:00:00", 10046, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192201, 0.0, 24004, "アサヒ", 24, 2, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1, 701, "2020/07/31 12:00:00", 10046, 1.99, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192201, 0.0, 24005, "アサヒ", 24, 1, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2, 702, "2020/07/31 12:00:00", 10046, 2.21, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192201, 0.0, 24006, "アサヒ", 24, 2, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 1, 703, "2020/07/31 12:00:00", 10046, 3.33, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192301, 0.0, 24007, "部員３", 24, 2, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 801, "2020/07/31 12:00:00", 10046, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192301, 0.0, 24008, "部員３", 24, 1, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2, 802, "2020/07/31 12:00:00", 10046, 2.68, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192301, 0.0, 24009, "部員３", 24, 2, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 803, "2020/07/31 12:00:00", 10046, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192501, 0.0, 24010, "", 24, 1, 0.0, "やった！", 1, 501, "2020/07/31 12:00:00", 10046, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192501, 0.0, 24011, "", 24, 1, 0.0, "勝ったよ！", 1, 502, "2020/07/31 12:00:00", 10046, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192501, 0.0, 24012, "", 24, 1, 0.0, "いい調子！", 1, 503, "2020/07/31 12:00:00", 10046, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (113501, 0.0, 24013, "ミサト", 24, 6, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 2, 111, "2020/07/31 12:00:00", 10046, 5.33, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (113501, 0.0, 24014, "ミサト", 24, 1, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 2, 112, "2020/07/31 12:00:00", 10046, 6.85, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (113501, 0.0, 24015, "ミサト", 24, 1, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 2, 113, "2020/07/31 12:00:00", 10046, 3.0, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192401, 0.0, 24016, "ダイチ", 24, 1, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 2, 611, "2020/07/31 12:00:00", 10046, 6.11, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192401, 0.0, 24017, "ダイチ", 24, 1, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 2, 612, "2020/07/31 12:00:00", 10046, 6.75, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192401, 0.0, 24018, "ダイチ", 24, 2, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 613, "2020/07/31 12:00:00", 10046, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (113401, 0.0, 24019, "ハツネ", 24, 2, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 1, 211, "2020/07/31 12:00:00", 10046, 4.52, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (113401, 0.0, 24020, "ハツネ", 24, 2, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 1, 212, "2020/07/31 12:00:00", 10046, 3.89, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (113401, 0.0, 24021, "ハツネ", 24, 1, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 2, 213, "2020/07/31 12:00:00", 10046, 13.49, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (106501, 0.0, 24022, "カヤ", 24, 1, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 2, 311, "2020/07/31 12:00:00", 10046, 3.17, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (106501, 0.0, 24023, "カヤ", 24, 1, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 2, 312, "2020/07/31 12:00:00", 10046, 4.42, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (106501, 0.0, 24024, "カヤ", 24, 6, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 1, 313, "2020/07/31 12:00:00", 10046, 2.89, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (102301, 0.0, 24025, "アヤネ", 24, 4, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3, 421, "2020/07/31 12:00:00", 10046, 3.71, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192201, 0.0, 24026, "アサヒ", 24, 2, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 1, 721, "2020/07/31 12:00:00", 10046, 5.1, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192301, 0.0, 24027, "部員３", 24, 1, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 3, 821, "2020/07/31 12:00:00", 10046, 4.34, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (192501, 0.0, 24028, "", 24, 1, 0.0, "いい勝負だったよ\nまたやろうね", 1, 521, "2020/07/31 12:00:00", 10046, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (113501, 0.0, 24029, "ミサト", 24, 1, -360.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 2, 101, "2020/07/31 12:00:00", 10046, 5.62, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (113501, 0.0, 24030, "ミサト", 24, 1, -360.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 2, 102, "2020/07/31 12:00:00", 10046, 9.58, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (113501, 0.0, 24031, "ミサト", 24, 2, -360.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 103, "2020/07/31 12:00:00", 10046, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (113501, 0.0, 24032, "ミサト", 24, 2, -360.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 1, 104, "2020/07/31 12:00:00", 10046, 9.13, "2030/12/17 14:59:59");
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (113501, 0.0, 24033, "ミサト", 24, 1, -360.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 2, 105, "2020/07/31 12:00:00", 10046, 8.27, "2030/12/17 14:59:59");
